Прем'є́р-міні́стр (від фр. le premier — перший) — перший, головний міністр, голова уряду в сучасних державах. У деяких державах вибирається на всенародних виборах, в інших затверджується парламентом після подання голови держави (Республіка Білорусь, Російська Федерація); або призначається головою держави (Сполучене Королівство, Французька Республіка). Прем'єр-міністр призначає й відстороняє від посади міністрів, керує повсякденною діяльністю уряду, очолює адміністративний апарат. Як правило, прем'єр-міністр — лідер політичної партії, що має більшість у парламенті, або лідер партійної коаліції, і керує фракцією парламентської більшості. У різних державах ця посада має різну назву. Окремі приклади наведені нижче: 
* Україна — Прем'єр-міністр України, він же Голова Кабінету Міністрів України; 
* Франція — Прем'єр-міністр (фр. le Premier Ministre de la République Française); 
* Велика Британія — Прем'єр-міністр (англ. Prime Minister of the United Kingdom of Great Britain and Northern Ireland); 
* Італія — Голова Ради Міністрів, (італ. Presidente del Consiglio dei Ministri); 
* Іспанія — Голова уряду (ісп. Presidente del Gobierno); 
* Чехія — Прем'єр (перекладається як голова); 
* Німеччина — Федеральний канцлер Німеччини; 
* Австрія — Федеральний канцлер Австрії; 
* Ірландія — Ті́шах (ірл. Taoiseach).

Le Premier ministre est généralement le chef du gouvernement dans les régimes au pouvoir exécutif bicéphale. Dans certains régimes parlementaires, entre autres celui du Royaume-Uni, ou dans un régime semi-présidentiel, le Premier ministre et son gouvernement sont responsables devant le parlement. Le Premier ministre est généralement élu par le Parlement, éventuellement sur proposition du chef de l'État, ou bien nommé directement par le chef de l'État. Le terme « Premier ministre » signifie la primauté par rapport aux autres ministres du gouvernement ou du cabinet auquel appartient la personne nommée à cette fonction. Pour la Grande-Bretagne, en anglais, la notion est traduite de deux manières différentes : on parle de Prime minister pour le gouvernement central à Londres, et de First minister pour les gouvernements régionaux en Irlande du Nord et en Écosse. Au Canada, le terme Premier ministre désigne, en français, autant le titulaire fédéral que les chefs de gouvernements provinciaux. En anglais toutefois, le terme Prime minister est utilisé pour désigner le chef du gouvernement fédéral et le terme Premier pour désigner les chefs de gouvernements provinciaux. Toutefois, selon les juridictions, d'autres termes équivalents sont utilisés : 
* chancelier : en Allemagne et en Autriche ; 
* président du Conseil des ministres : en Italie, au Liban, en Pologne ou en France, entre 1815 et 1848 et sous les IIIe et IVe Républiques ; 
* président du gouvernement : en Espagne, Russie, Tchéquie ou Croatie ; 
* chef de gouvernement : au Maroc ou en Tunisie ; 
* ministre d'État (Staatsminister) : à Monaco, en Suède, au Danemark et en Norvège ; 
* ministre-président : aux Pays-Bas, dans les Länder allemands ou les régions et les quatre communautés de Belgique ; 
* ministre en chef (Chief minister) : dans les États et territoires de l'Inde, provinces du Pakistan, territoires d'Australie ou les Territoires britanniques d'outre-mer.
